import React from "react";
import { Card } from "react-bootstrap";

export const Cardy = () => {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Img variant="top" src="/logo512.png" />
      <Card.Body>
        <Card.Title>Titulo</Card.Title>
        <Card.Text>Exemplo de conteudo</Card.Text>
      </Card.Body>
    </Card>
  );
};
